description:
Week 22 of TEMPLATE, a new digital comics series from QAM Comics. Fans of Thrillbent, Monkeybrain, or DC Digital First style comics should definitely check it out.

As of last night, (9/10/13), our revamped Kickstarter campaign to do a small print version of TEMPLATE, Volume 1 has been funded! That said, we've still got three weeks to go. The only way to get a print copy of this for the foreseeable future will be through this campaign, so if you want one be sure to head on over and pledge!
 &lt;a href=&quot;
